import axios from 'axios';
import { Bar, BarChart, CartesianGrid, ComposedChart, Legend, Line, LineChart, Scatter, ScatterChart, Tooltip, XAxis, YAxis } from 'recharts';
const data = [
  { 군구: '광진구', 유동인구수: 32760, 비유동인구수: 34000 },
  { 군구: '동대문구', 유동인구수: 30480, 비유동인구수: 56000 },
  { 군구: '마포구', 유동인구수: 27250, 비유동인구수: 23000 },
  { 군구: '구로구', 유동인구수: 49870, 비유동인구수: 67000 },
  { 군구: '강남구', 유동인구수: 51420, 비유동인구수: 55000 },
];
class Test extends Node {
  constructor(props){
    super(props)
    this.state={
      append_FPList:undefined
    }
  }
  f1 = ()=>{
    axios.get('https://api/formerData/temperature',{})
    .then((res)=>{
      console.log(res.data.entry);
      this.setState({append_FPList:res.data.entry})
      })
  }
  render() {
    return (
      <div>
        <h1>Temperature 이전 데이터 확인</h1>
        <button onClick={this.f1}>버튼</button>
        <ResponsiveContainer>
          <AreaChart
            data={rangeData}
            margin={{
              top: 16,
              right: 16,
              bottom: 0,
              left: 24,
            }}
          >
            <XAxis
              dataKey="time"
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            />
            <YAxis
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            >
              <Label
                angle={270}
                position="left"
                style={{
                  textAnchor: 'middle',
                  fill: theme.palette.text.primary,
                  ...theme.typography.body1,
                }}
              >
                Temperature

              </Label>
            </YAxis>
            <Area dataKey="temp1" stroke="#8884d8" fill="#8884d8" />
            <Area dataKey="temp2" stroke="#8884d8" fill="yellow" />
            <Tooltip />
          </AreaChart>
        </ResponsiveContainer>
      </div>
    );
  }
}
export default Test;
